import React, { useState } from 'react';
import { CircleX } from 'lucide-react';

const Dashboard = () => {
    const [currentIndex, setCurrentIndex] = useState(0);
    const default_image = "https://via.placeholder.com/150";
    const [empoloyees, setEmployees] = useState([
        { name: "jethalal", age: 40, img: "data:image/jpeg;base64," },
        { name: "daya", age: 40, img: "data:image/jpeg;base64," },
        { name: "hathi", age: 50, img: "data:image/jpeg;base64," },
        { name: "komal", age: 40, img: "data:image/jpeg;base64," },
        { name: "mehta", age: 30, img: "data:image/jpeg;base64," },
        { name: "anjali", age: 70, img: "data:image/jpeg;base64," },
        { name: "iyer", age: 40, img: "data:image/jpeg;base64," },
        { name: "babita", age: 30, img: "data:image/jpeg;base64," }
    ]);

    const removePerson = (idx) => {
        const updatedEmployees = empoloyees.filter((_, index) => index !== idx);
        setEmployees(updatedEmployees);

        if (currentIndex >= updatedEmployees.length) {
            setCurrentIndex(Math.max(0, updatedEmployees.length - 1));
        }
    };

    const changeIndex = (idx) => {
        setCurrentIndex(idx);
    };

    const addUser = () => {
        const userName = document.getElementById('name').value.trim();
        const userAge = document.getElementById('age').value.trim();
        const userImage = document.getElementById('image-url').value.trim();

        if (!userName || !userAge || !userImage) {
            return;
        }

        const newUser = { name: userName, age: userAge, img: userImage };
        setEmployees((prevEmployees) => [...prevEmployees, newUser]);

        // Clear input fields
        document.getElementById('name').value = "";
        document.getElementById('age').value = "";
        document.getElementById('image-url').value = "";
    };

    return (
        <>
            <div className='h-[35rem] w-[55rem] flex justify-center items-center bg-red-300 border border-3 border-white rounded-3xl shadow-2xl gap-4'>
                <div className='h-[30rem] w-[15rem] border border-3 border-white p-10 flex flex-col gap-2 overflow-x-hidden overflow-y-auto'>
                    {empoloyees.map((data, idx) => (
                        <div key={idx} className='flex'>
                            <div onClick={() => changeIndex(idx)} className='h-[5rem] cursor-pointer flex flex-col bg-slate-300 w-[10rem] border border-3 border-red-500 text-black'>
                                <span>Name: {data.name}</span>
                                <span>Age: {data.age}</span>
                            </div>
                            <CircleX className='h-12 w-12 hover:cursor-pointer' onClick={() => removePerson(idx)} />
                        </div>
                    ))}
                </div>

                <div className='h-[30rem] w-[35rem] flex flex-col justify-center items-center border border-3 border-white p-4'>
                    <div>
                        <img src={empoloyees.length > 0 ? empoloyees[currentIndex]?.img || default_image : default_image} alt="Profile" className="h-32 w-32 rounded-full" />
                    </div>
                    <div className='flex flex-col text-black'>
                        <span className='text-2xl'>Name: {empoloyees.length > 0 ? empoloyees[currentIndex]?.name : "N/A"}</span>
                        <span className='text-2xl'>Age: {empoloyees.length > 0 ? empoloyees[currentIndex]?.age : "N/A"}</span>
                    </div>
                </div>
            </div>

            <div className='h-[15rem] bg-red-300 p-4 flex justify-center items-center flex-col gap-1 w-[40rem] ml-[7rem] rounded-b-2xl'>
                <table className="border-collapse border border-black w-full mt-10">
                    <tbody>
                        <tr>
                            <td className="border border-black p-2 text-black">Enter Name:</td>
                            <td className="border border-black p-2">
                                <input type="text" id="name" className="border border-black border-3 w-full" required />
                            </td>
                        </tr>
                        <tr>
                            <td className="border border-black p-2 text-black">Enter Age:</td>
                            <td className="border border-black p-2">
                                <input type="text" id="age" className="border border-black border-3 w-full" required />
                            </td>
                        </tr>
                        <tr>
                            <td className="border border-black p-2 text-black">Enter Image URL:</td>
                            <td className="border border-black p-2">
                                <input type="text" id="image-url" className="border border-black border-3 w-full" required />
                            </td>
                        </tr>
                    </tbody>
                </table>
                <button onClick={addUser} className="mt-4 px-4 py-2 bg-blue-500 text-white rounded">Add User</button>
            </div>
        </>
    );
};

export default Dashboard;
